import InterestService from '../services/interests.service'

const Interests = () => {
    const getAllAvailableInterest = () => {
        var alist = [];
        InterestService.getInterestList().then(response => {
            alist = response.interests
        });
        return alist
    }

    const getAvailableInterests = (array) => {
        var list = this.getAllAvailableInterest().filter(function(e) {
            return !(array.includes(e));
        });
        return list;
    }
}

export default new Interests();
